import React from "react";

function Habit() {
  return (
    <div className="habit">
      <div className="habit-text">
        <h2>WAKE UP EARLY</h2>
        <p>WEEKLY: 03/03 MIN</p>
      </div>
      <p className="habit-counter">3</p>
    </div>
  );
}

export default Habit;
